import { Swiper, SwiperSlide } from "swiper/react";

// Import Swiper styles
import "swiper/css";
import "swiper/css/pagination"



const AmazingProduct = () => {
  return (
    <div className='w-full bg-red-700'>
      <div className='container mx-auto'>
        <div className='w-2/6 xl:w-1/6'></div>
        <div className='w-4/6 p-2 md:p-4' dir='rtl'>
          <Swiper slidesPerView={1} spaceBetween={5}
            pagination={{ "clickable": true }}
            breakpoints={{
              "@0.00": {
                "slidesPerView": 1,
                "spaceBetween": 10
              },
              "@0.75": {
                "slidesPerView": 1.35,
                "spaceBetween": 10
              },
              "@1.00": {
                "slidesPerView": 1.80,
                "spaceBetween": 10
              },
              "@1.50": {
                "slidesPerView": 3,
                "spaceBetween": 10
              },
              "@1.80": {
                "slidesPerView": 3.25,
                "spaceBetween": 10
              },
              "@2.00": {
                "slidesPerView": 3.5,
                "spaceBetween": 10
              }
            }} className="mySwiper">
            <SwiperSlide className='rounded-md w-auto p-2'><div className='w-32 h-80'></div></SwiperSlide>
            <SwiperSlide className='rounded-md w-auto p-2'><div className='w-32 h-80'></div></SwiperSlide>
            <SwiperSlide className='rounded-md w-auto p-2'><div className='w-32 h-80'></div></SwiperSlide>
            <SwiperSlide className='rounded-md w-auto p-2'><div className='w-32 h-80'></div></SwiperSlide>
            <SwiperSlide className='rounded-md w-auto p-2'><div className='w-32 h-80'></div></SwiperSlide>
            <SwiperSlide className='rounded-md w-auto p-2'><div className='w-32 h-80'></div></SwiperSlide>
            <SwiperSlide className='rounded-md w-auto p-2'><div className='w-32 h-80'></div></SwiperSlide>
            <SwiperSlide className='rounded-md w-auto p-2'><div className='w-32 h-80'></div></SwiperSlide>
            <SwiperSlide className='rounded-md w-auto p-2'><div className='w-32 h-80'></div></SwiperSlide>
            <SwiperSlide className='rounded-md w-auto p-2'><div className='w-32 h-80'></div></SwiperSlide>
          </Swiper>
        </div>
      </div>
    </div>
  );
}

export default AmazingProduct;
